    <script>
      const selectedDataDom = document.querySelector(".js-selected-data");
      google.charts.load("current", { packages: ["gantt"] });
      google.charts.setOnLoadCallback(drawChart);

      function daysToMilliseconds(days) {
        return days * 24 * 60 * 60 * 1000;
      }

      function drawChart() {
        var data = new google.visualization.DataTable();

        data.addColumn("string", "Task ID");
        data.addColumn("string", "Task Name");
        data.addColumn("date", "Start Date");
        data.addColumn("date", "End Date");
        data.addColumn("number", "Duration");
        data.addColumn("number", "Percent Complete");
        data.addColumn("string", "Dependencies");

        const bData = this.baseData();

        const filteredData = bData.filter((item) => {
          if (typeof item.properties.文字 === "object") {
            if (
              item.properties.文字.工種 &&
              item.properties.文字.納品日 &&
              item.properties.文字.施工日 &&
              item.properties.文字.検査日
            ) {
              return true;
            }
          }
          return false;
        });

        const returnVal = filteredData.reduce((acc, item) => {
          acc = acc.concat([
            [
              item.name + " - 納品日",
              item.name + " - 納品日",
              new Date(
                2021,
                item.properties.文字.納品日.split("/")[0],
                item.properties.文字.納品日.split("/")[1]
              ),
              new Date(
                2021,
                item.properties.文字.施工日.split("/")[0],
                item.properties.文字.施工日.split("/")[1]
              ),
              null,
              0,
              null,
            ],
            [
              item.name + " - 施工日",
              item.name + " - 施工日",
              new Date(
                2021,
                item.properties.文字.施工日.split("/")[0],
                item.properties.文字.施工日.split("/")[1]
              ),
              new Date(
                2021,
                item.properties.文字.検査日.split("/")[0],
                item.properties.文字.検査日.split("/")[1]
              ),
              null,
              0,
              item.name + " - 納品日",
            ],
            [
              item.name + " - 検査日",
              item.name + " - 検査日",
              new Date(
                2021,
                item.properties.文字.検査日.split("/")[0],
                item.properties.文字.検査日.split("/")[1]
              ),
              new Date(
                2021,
                item.properties.文字.検査日.split("/")[0],
                parseInt(item.properties.文字.検査日.split("/")[1]) + 1
              ),
              null,
              0,
              item.name + " - 施工日",
            ],
          ]);
          return acc;
        }, []);

        data.addRows(returnVal);

        var options = {
          height: 10000,
        };

        var chart = new google.visualization.Gantt(
          document.getElementById("chart_div")
        );

        google.visualization.events.addListener(chart, "select", function () {
          if (chart.getSelection().length === 0) {
            selectedDataDom.innerHTML = "未選択";
          } else {
            selectedDataDom.innerHTML = JSON.stringify(
              returnVal[chart.getSelection()[0].row]
            );
          }
        });

        chart.draw(data, options);
      }
